import React from 'react';
import './App.css';

class App extends React.Component {
  render () {
    return (
    <div className="App">
      <form className="login-form">
            <input type="text" asp-for="AlLogin" className="form-control input login-field form-control" placeholder="Login here"/>
            <input type="password" asp-for="AlPassword" className="form-control input login-field form-control" placeholder ="Password here" />
            <input type="submit" value="LOGIN" className=" input login-button btn btn-secondary"/>
        </form>
    </div>
    );
  }
}

export default App;
